let initMoney ={
    money:1000
};
 let reducer = (state = initMoney,action)=>{
    switch (action.type){
        case "ADD":state.money ++ ; return {...state};
        case "DEL":state.money -- ; return {...state};
        default: return state
    }
};


 export default reducer
